import React, { useContext } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Header } from "./components/headers/Header";
import { Pages } from "./components/mainpages/Pages";
import PaginaPrincipal from "./components/paginaPrincipal/PaginaPrincipal";
import { DataProvider, GlobalState } from "./GlobalState";
import "./App.css";
import Navbar from "./components/Navbar/Navbar";
import { Home } from "./pages/Home/Home";
import { Services } from "./pages/Services/Services";
import { Products } from "./pages/Products/Products";
import { SingUp } from "./pages/SingUp/SingUp";
import DetailProduct from "./components/mainpages/detailProduct/DetailProduct";
import { Register } from "./pages/SingUp/Register";
import Cart from "./pages/cart/Cart";
import { NotFound } from "./components/mainpages/utils/notFound/NotFound";

function App() {
  const state = useContext(GlobalState);
  const [isLogged] = state.userApi.isLogged

  return (
    <DataProvider>
      <Router>
        <div className="App">
          <Navbar />
          <Switch>
            <Route path="/" exact component={Home} />
            <Route path="/services" component={Services} />
            <Route path="/products" component={Products} />
            <Route path="/sign-up" component={isLogged ? NotFound : SingUp} />
            <Route path="/detail/:id" exact component={DetailProduct} />
            <Route
              path="/register"
              exact
              component={isLogged ? NotFound : Register}
            />
            <Route path="/cart" exact component={Cart} />
          </Switch>
        </div>
      </Router>
    </DataProvider>
  );
}

export default App;
